member.example:
This sample shows how to call DefaultAsync.

ResponseHeader client = new DatetimeClient().GetResponseHeaderClient();

Response response = await client.DefaultAsync();

Console.WriteLine(response.Status);

This sample shows how to call DefaultAsync with all request content.

ResponseHeader client = new DatetimeClient().GetResponseHeaderClient();

Response response = await client.DefaultAsync();

Console.WriteLine(response.Status);

